C.lT=new H.aY(3,{main:"Developping a full stack application for network architects \nto build from scratch network Fabrics in lab. Major project \nfor the Network Data Center Architecture team, the application\nis centered around a DataModel service, a Build service and \na Configure service. These enable the team to model a network \nFabric, generate the appropriate nodes configuration, \nautomatically build and configure virtual fabrics (Arista and \nCisco) in Eve NG and push configurations through Ansible AWX \napplication.\n\nIn the first phase of the project, my focus was to build a \nfunctional proof of concept around the Build et Configure \nservices. Discovering the API for EveNG, building my own \nAPIs (with Connexion and Flask) and client libraries, laying \nout services around Python Celery tasks, and delivering a \nuser interface with VueJS.\n",second:"My current side projects include making static websites using\nFlutter. This allows me to experiment with the SDK and Dart \nlanguage before moving on to mobile apps.\n\nWhat brought me to Flutter was animation. I wanted to have a\npersonal portfolio website with an animated avatar. I first \ndiscovered Rive (formerly Flare) and learned how to build a \nbasic animated avatar. But integration with JavaScript seemed\ndaunting and not documented at the moment. As their Flutter\nruntime was heavily promoted (on Medium, Youtube), it \nrenewed  my interest and got me into reading a book about \nFlutter and Dart. Further readings took me to the AppBrewery\nFlutter bootcamp (and its amazing instructor Angela Yu).\n",third:"With LinuxAcademy I also self-train on Linux and Kubernetes to\nprepare both Linux CFA and Kubernetes CFA by the end of 2020.\n\nMy personal stack includes Gitlab for CI/CD and Digital Ocean \nas hosting for this website portfolio and.   \n"},C.wF,u.hD)
